import React, { useState, useEffect } from "react";
import MenuData from "./menu";

const GalleryReact = () => {
  const [items, setItems] = useState(MenuData);
  const [activeCategories, setActiveCategories] = useState(["All"]);
  const [searchQuery, setSearchQuery] = useState("");

  useEffect(() => {
    if (activeCategories.includes("All")) {
      setItems(MenuData);
    } else {
      const filteredItems = MenuData.filter((item) => {
        if (activeCategories.length === 1) {
          return Array.isArray(item.category)
            ? item.category.includes(activeCategories[0])
            : item.category === activeCategories[0];
        } else {
          return (
            Array.isArray(item.category) &&
            activeCategories.every((category) => item.category.includes(category))
          );
        }
      });
      setItems(filteredItems);
    }
  }, [activeCategories]);

  useEffect(() => {
    const filteredItems = MenuData.filter((item) =>
      item.name.toLowerCase().includes(searchQuery.toLowerCase())
    );
    setItems(filteredItems);
  }, [searchQuery]);

  const handleCategoryClick = (category) => {
    if (category === "All") {
      setActiveCategories(["All"]);
    } else {
      setActiveCategories((prevCategories) => {
        const newCategories = prevCategories.includes(category)
          ? prevCategories.filter((c) => c !== category)
          : [...prevCategories, category];

        return newCategories.includes("All")
          ? newCategories.filter((c) => c !== "All")
          : newCategories;
      });
    }
  };

  const allCategories = [
    "All",
    ...new Set(MenuData.flatMap((item) =>
      Array.isArray(item.category) ? item.category : [item.category]
    )),
  ];

  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container">
          <span className="navbar-brand">Alternative ways to visualise data</span>
          <p className="navbar-text">
            One sentence about the website
          </p>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav ml-auto">
              {allCategories.map((category) => (
                <li className="nav-item" key={category}>
                  <a
                    className={`nav-link ${activeCategories.includes(category) && "active"}`}
                    href="javascript:0;"
                    onClick={() => handleCategoryClick(category)}
                    style={{
                      backgroundColor: activeCategories.includes(category) ? "#add8e6" : "transparent",
                      color: activeCategories.includes(category) ? "white" : "inherit",
                      marginRight: "10px",
                      borderRadius: "10px",
                    }}
                  >
                    {category}
                  </a>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </nav>

      <div className="container mt-4">
        <ul className="nav nav-pills justify-content-center">
          {/* ... Rest of the code */}
        </ul>
      </div>

      <div className="container mt-2 mb-4">
        <input
          type="text"
          className="form-control form-control-sm"
          placeholder="Search by name..."
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
      </div>

      <div className="container-fluid">
        <div className="row">
          {/* ... Rest of the code */}
        </div>
      </div>

      <footer className="footer mt-auto py-3 bg-light text-center">
        <div className="container">
          <p className="m-0">This website is for demonstration purposes only. All images and data are provided for educational use.</p>
        </div>
      </footer>
    </>
  );
};

export default GalleryReact;
